import React from "react";

const HomePage = () => {
  return (
    <div className="w-11/12 flex items-center border p-10">
      <div className="w-4/12 border">
        <div className="border-2 w-11/12 flex items-center m-2">
          <span className=" text-4xl font-thin text-orange-800 flex justify-end  ">
            Welcome to your <br /> professional society !
          </span>
        </div>

        <div className="flex p-5 justify-end border-2">

        </div>
      </div>
    </div>
  );
};

export default HomePage;
